import React, { useState, useEffect } from "react";
import "../index.css";

function CodeNames() {
  const [gameWords, setGameWords] = useState([]);

  useEffect(() => {
    fetchGameWords();
  }, []);

  const fetchGameWords = async () => {
    try {
      const response = await fetch("/start_codenames_game");
      const data = await response.json();
      setGameWords(data);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="codenames">
      <button onClick={fetchGameWords}>Start Game</button>
      <div className="grid">
        {Object.entries(gameWords).map(([word, color], index) => (
          <div key={index} className={`box ${color}`}>
            {word}
          </div>
        ))}
      </div>
    </div>
  );
}

export default CodeNames;
